mapper.select:

select 

from MSGINE
where MSGINE_TXDATE = #{msgineTxdate,jdbcType=CHAR}
  and MSGINE_BRNO = #{msgineBrno,jdbcType=CHAR}
  and MSGINE_FEPNO = #{msgineFepno,jdbcType=CHAR}

mapper.delete:

delete from MSGINE
where MSGINE_TXDATE = #{msgineTxdate,jdbcType=CHAR}
  and MSGINE_BRNO = #{msgineBrno,jdbcType=CHAR}
  and MSGINE_FEPNO = #{msgineFepno,jdbcType=CHAR}
